// src/App.js
import React, { useEffect } from 'react';
import { supabase } from './supabase';

function App() {
  useEffect(() => {
    supabase
      .from('visitas')
      .select('*')
      .then(({ data, error }) => {
        console.log('Visitas:', data, 'Erro:', error);
      });
  }, []);

  return (
    <div style={{ padding: 20 }}>
      <h1>Teste de conex√£o Supabase</h1>
      <p>Abra o console do navegador para ver o resultado.</p>
    </div>
  );
}

export default App;
